        setDates({ ...dates, [e.target.name]: e.target.value });
      };
    
      // ส่งวันที่ไป Flask และรับรายการรูปภาพ
      const fetchImages = async () => {
        try {
          const response = await axios.post("http://127.0.0.1:5000/get-images", dates, {
            headers: { "Content-Type": "application/json" },
